import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EventsHeader from './EventsHeader';
import Navigation from '../Navigation';
import SideMenu from '../SideMenu';
const Events = () => {
    // test with zipCode -> cleanUrls with urls array -> promise array with promises containing clean urls
    const [zipCode, setZipCode] = useState("94109")
    const [urlData, setUrlData] = useState([]);
    const [cleanUrls, setCleanUrls] = useState([]);

    useEffect(() => {
        axios.get("/test", {params: { zipCode: zipCode} })
        .then((response) => {
            setUrlData(response.data)
        })
        .catch((error) => {
            console.log(error);
        })


    }, [])
    //#endregion
    useEffect(() => {
        for(const url of urlData){

            axios.get("/cleanUrl", {params: { url: url } })
            .then((response) => {
                setCleanUrls([...cleanUrls,response.data] );
                console.log(cleanUrls)
            })
            .catch((error) => {
                console.log(error);
            })
        }


    }, [])

    return (
        <div>
            <Navigation />
            <EventsHeader />
            <SideMenu />
            <p>{cleanUrls.length}</p>
            <div>
                { 

                cleanUrls.map((url, i) => {
                    return (
                        <p key={i}>{url}</p>
                    )
                })

                }
            </div>
        </div>
    );
};

export default Events;
